PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE Guns (
    Gun_ID INTEGER PRIMARY KEY AUTOINCREMENT,
    Turret_ID INTEGER,
    Country TEXT,
    Caliber TEXT,
    Length TEXT,
    Mark_Designation TEXT,
    Year_Introduced INTEGER,
    Weight REAL,
    Modded INTEGER DEFAULT 0,
    Notes TEXT,
    FOREIGN KEY (Turret_ID) REFERENCES Turrets(Turret_ID)
);
CREATE TABLE Gun_Ammunition_Compatibility (
    Compatibility_ID INTEGER PRIMARY KEY AUTOINCREMENT,
    Gun_ID INTEGER NOT NULL,
    Ammunition_ID INTEGER NOT NULL,
    Notes TEXT, Caliber TEXT, Muzzle_Velocity_FPS REAL, Muzzle_Velocity_MPS REAL, Max_Range_Yards REAL, Barrel_Wear_Per_Round REAL,
    FOREIGN KEY (Gun_ID) REFERENCES Guns(Gun_ID),
    FOREIGN KEY (Ammunition_ID) REFERENCES Ammunition(ID),
    UNIQUE(Gun_ID, Ammunition_ID)
);
CREATE TABLE IF NOT EXISTS "Ammunition" (
    ID INTEGER PRIMARY KEY AUTOINCREMENT,
    Turret_ID INTEGER,
    Caliber TEXT,
    Mark_Designation TEXT,
    Projectile_Type TEXT,
    Weight_LBS REAL,
    Length_IN REAL,
    Bursting_Charge REAL,
    Kinetic_Energy_MJ REAL,
    Cartridge_Type TEXT,
    Year_Introduced INTEGER,
    Country TEXT,
    Modded INTEGER DEFAULT 0,
    Notes TEXT,
    FOREIGN KEY (Turret_ID) REFERENCES Turrets(Turret_ID)
);
CREATE TABLE IF NOT EXISTS "Turrets" (
    Turret_ID INTEGER PRIMARY KEY AUTOINCREMENT,
    Gun_ID INTEGER,
    Country TEXT,
    Caliber TEXT,
    Turret_Type TEXT,
    Designation TEXT,
    Turret_Weight_Tons REAL,
    Crew_Size INTEGER,
    Armor_Face_IN REAL,
    Armor_Sides_IN REAL,
    Armor_Roof_IN REAL,
    Traverse_Rate_Deg_Sec REAL,
    Elevation_Min_Deg REAL,
    Elevation_Max_Deg REAL,
    Elevation_Rate_Deg_Sec REAL,
    Rate_Of_Fire_RPM REAL,
    Modded INTEGER DEFAULT 0,
    Notes TEXT,
    FOREIGN KEY (Gun_ID) REFERENCES Guns(Gun_ID)
);
CREATE INDEX idx_compat_gun ON Gun_Ammunition_Compatibility(Gun_ID);
CREATE INDEX idx_compat_ammo ON Gun_Ammunition_Compatibility(Ammunition_ID);
COMMIT;
