INSERT INTO Turrets VALUES(10,396,'USA','16"','Twin','16"/50 Mark 7 Twin Turret',1200.0,55,17.5,9.5,7.25,5.0,-5.0,45.0,14.0,2.0,1,'Fictional twin-gun turret using Mark 7 gun. Lighter than triple turret with faster traverse. Estimated for hypothetical destroyer leader or pocket battleship design.');
INSERT INTO Turrets VALUES(11,398,'USA','16"','Twin','16"/50 Mark 2/3 Twin Turret',820.0,52,15.0,8.0,4.5,3.5,-5.0,35.0,9.0,2.0,1,'Fictional twin turret for cancelled Mark 2/3 gun. Estimated specs if Lexington battlecruisers had used twin mounts instead of triple.');
