INSERT INTO Turrets VALUES(13,397,'USA','16"','Triple','16"/45 Mark 1 Triple Turret',1650.0,78,18.0,10.0,5.0,1.5,-5.0,30.0,3.5,1.5,1,'Fictional triple turret using Mark 1 gun. Estimated specs if Colorado-class had been designed with triple turrets like later battleships. Would be very heavy and slow to traverse.');
